import React from 'react'
import Navbar from './Navbar'
import '../CSS/Profile.css';
export default function Profile() {
  return (
   <>
   <Navbar/>
   <div class="cover"></div>
  <div class="profile-container">
    <div class="profile-picture"></div>
    <div class="user-info">
      <h2>Your Name</h2>
      <p>Web Developer</p>
      {/* <!-- Add more information as needed --> */}
    </div>
  </div>
  {/* <!--Image Grid--> */}
  {/* <!--Start--> */}
  <div class="image-grid">
    <img src="champion-golden-trophy-winner-background-success-achievement-concept-sport-cup-award-theme-149813218.webp"
      alt="Image 1"/>
    <img src="logo.jpeg" alt="Image 2"/>
    <img src="profile.webp" alt="Image 3"/>
    {/* <!-- Add more images as needed --> */}
  </div>
   </>
  )
}
